def plot(speedUp, lineType):
    colors = ['red', 'blue', 'green', 'yellow', 'black', 'purple']
    t = 'task' if lineType == '-' else ''
    # 计算每个线程数的平均speedUp
    avg_speedUp_per_view = [[np.mean(speedUp[i][j]) for i in range(len(threads))] for j in range(6)]
    for i in range(6):
        plt.plot(threads, avg_speedUp_per_view[i], color=colors[i], label='{}Average SpeedUp in view {}'.format(t+' ', i+1), linestyle=lineType, marker='x', markersize=12)

    if t != 'task':
        return 
    for i, thread in enumerate(threads):
        for j in range(6):
            for s in speedUp[i][j]:
                plt.scatter(thread, s, color=colors[j], s=8)

